import React from 'react';
import './Header.css';
import logo from "../../img/menu.png";

function Header() {
  return (
    <div className="Header">
      <header className="header__header">
        <img src={logo} className="header__logo" alt="logo" />

      </header>
    </div>
  );
}

export default Header;
